import "./App.css";

function Footer({ name }) {
  return (
    <footer class="footer">
      Designed & Developed by {name} (2&#x2764;&#xfe0f;24) Sri Vasavi Engg.
      College
    </footer>
  );
}

function App() {
  return (
    <>
      <div class="container-fluid">
        <h1 class="title">PhishDefender</h1>
        <div class="content">
          <p>
            Think before you click!
            <br />
            We wish you're not going to be a victim...
          </p>
            <div class="form-group">
              <TextField
                id="standard-basic"
                label="Standard"
                variant="standard"
              />
            </div>
            <button type="submit" class="btn btn-primary submit-btn">
              Submit
            </button>

        </div>
      </div>
      <Footer name={"Subhan Saheb Shaik"}></Footer>
    </>
  );
}

export default App;
